  render() {
    return (
      <div className="App">
        <div className="background-blobs">
          <div className="blob blob-1"></div>
          <div className="blob blob-2"></div>
          <div className="blob blob-3"></div>
          <div className="blob blob-4"></div>
        </div>

        <div className="main-content">
          <Header />

        </div>

        <Footer />
      </div>
    );
  }
}

export default App;
